import React, { useState, useEffect } from 'react';
import firebase from 'firebase/app';
import 'firebase/storage';

function Services() {
  const [imageUrl, setImageUrl] = useState('');

  useEffect(() => {
    // Initialize Firebase app if it hasn't been already
    if (!firebase.apps.length) {
      firebase.initializeApp({
        // Your Firebase config object
      });
    }

    // Get a reference to the image file in Firebase Storage
    const storageRef = firebase.storage().ref().child('paint.JPEG');

    // Get the download URL for the image
    storageRef.getDownloadURL().then((url) => {
      setImageUrl(url);
    });
  }, []);

  return (
    <div className='h-screen bg-yellow-50 w-screen mx-5'>
      {imageUrl && <img src={imageUrl} alt='Paint' />}
    </div>
  );
}

export default Services;
